import React from 'react';
import { Link } from 'react-router-dom';
import Sidebar from '../components/Sidebar';

import './Header.css'; // Import the CSS file

function Header() {
    
    return (
        <>
        <button id="side-button" className='btn btn-success' href='#sidebar' data-bs-toggle="offcanvas" aria-controls="sidebar">
    <i className="bi bi-justify start-0 position-absolute top-0"  />
    </button>
        <header className="header">
        
            <h1 className="header-title">Starlight Tracker</h1>
            
    {/*<div className="scroll-container">  Scrollable container 
                
            </div>
            */}
            
        </header>
        <Sidebar />
        </>
    );
}

export default Header;
